       "( * x ( + ( * ( + x ( * ( - ( + 1.0 1.0 ) ( - 1.0 ( + ( - x x ) ( * x 1.0 ) ) ) ) ( + 1.0 x ) ) ) ( + ( - x ( * ( - ( * 1.0 x ) ( - 1.0 x ) ) 1.0 ) ) x ) ) 1.0 ) )"
